import React from 'react';

function Footer(props) {
    return(
    <div className="footer">
        <div className="container">
    
            <div className="row justify-content-center">             
                <div className="col-auto">
                    <p>© Copyright 2023 EMSI-4IIR</p>
                </div>
            </div>
        </div>
    </div>
    )
}

export default Footer;
